import React from 'react';

import classes from './RadioButton.module.css';

const radiobutton = (props) => {
  return (
      <label className={classes.customradiobtn} class="customradiobtn">
      <input type="radio" name="Testradio" id="RadioBtn" vale="Testradio1" 
      onClick={() => {
          var r = document.getElementById("RadioBtn")
          if (r.checked=true){
            r.checked=false
          }
          else {
            r.checked=true;
          }
      }}>
      
      
      </input>
      <span className={classes.checkmark} class="checkmark"></span>
      </label>
    
  );
}

export default radiobutton;
